import React from 'react';
import '@vkontakte/vkui/dist/vkui.css';
import connect from '@vkontakte/vk-connect';
import { View, Panel, Group, PanelHeader, CellButton, PanelHeaderBack, Text, Button, Header, Div, Root } from '@vkontakte/vkui';


class Profile extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            activeView: 'main'
          }
        }

componentDidMount () {
    connect.send("VKWebAppGetUserInfo", {}).then(e => this.setState({fetchedUser: e.data}))
}

            render() {
                return (
                  <View activePanel={this.state.activePanel}>
                    <Panel id="panel1">
                      <PanelHeader>Panel 1</PanelHeader>
                      <Group>
                        <CellButton onClick={ () => this.setState({ activePanel: 'panel2' }) }>
                          Go to panel 2
                        </CellButton>
                      </Group>
                    </Panel>
                    <Panel id="panel2">
                      <PanelHeader>Panel 2</PanelHeader>
                      <Group>
                        <CellButton onClick={ () => this.setState({ activePanel: 'panel3' }) }>
                          Go to panel 3
                        </CellButton>
                      </Group>
                    </Panel>
                    <Panel id="panel3">
                      <PanelHeader>Panel 3</PanelHeader>
                      <Group>
                        <CellButton onClick={ () => this.setState({ activePanel: 'panel1' }) }>
                          Back to panel 1
                        </CellButton>
                      </Group>
                    </Panel>
                  </View>
                )
              
}}
export default Profile;
